import React  from 'react'
import { useInput } from './useInput/useInput'

function App() {
    const check = text => text.length <= 10
    const name = useInput('Mr.', check);
    return (
        <>
            <h1>Hello</h1>
            <input placeholder={'Name'} {...name} />
        </>
    );
}

export default App;
